yx'=>'Onyx','Style variation nameRust'=>'Roest','Sub-heading of the featuresOur comprehensive suite of professional services caters to a diverse clientele, ranging from homeowners to commercial developers.'=>'Ons uitgebreide pakket van professionele diensten richt zich op een gevarieerde klantenkring, variërend van huiseigenaren tot commerciële ontwikkelaars.','Team'=>'Team','Template part nameFooter'=>'Footer','Template part nameHeader'=>'Header','Template part namePost Meta'=>'Bericht meta','Template part nameSidebar'=>'Zijbalk','Terms and Conditions'=>'Voorwaarden en condities','Testimonial Text or Review Text Got From the Person“Études has saved us thousands of hours of work and has unlocked insights we never thought possible.”'=>'"Études heeft ons duizenden uren werk bespaard en inzichten opgeleverd die we nooit voor mogelijk hadden gehouden."','Title text for the feature areaThe revitalized art gallery is set to redefine cultural landscape.'=>'De gerevitaliseerde kunstgalerij is klaar om het culturele landschap opnieuw te definiëren.','Tourist taking photo of a building'=>'Toerist maakt foto van een gebouw','Twenty Twenty-Four'=>'Twenty Twenty-Four','Twenty Twenty-Four is designed to be flexible, versatile and applicable to any website. Its collection of templates and patterns tailor to different needs, such as presenting a business, blogging and writing or showcasing work. A multitude of possibilities open up with just a few adjustments to color and typography. Twenty Twenty-Four comes with style variations and full page designs to help speed up the site building process, is fully compatible with the site editor, and takes advantage of new design tools introduced in WordPress 6.4.'=>'Twenty Twenty-Four is ontworpen om flexibel, veelzijdig en toepasbaar te zijn op elke site. De verzameling templates en patronen is afgestemd op verschillende behoeften, zoals het presenteren van een bedrijf, bloggen en schrijven of het presenteren van werk. Een veelheid 